post_body_text:
Christmas is around the corner, but we are still thinking about our incredible Thanksgiving—thanks to the Atlanta Falcons!

The annual Falcons Feast is sponsored by players from the offensive and defensive lines and this year, we asked a few of the players why they love giving back to the city that shows them so much love.

💛 We can’t thank @atlantafalcons and  @publix for making this event possible year after year for the CHRIS 180 community!

